INSERT INTO `events` VALUES ('077e48fa-f972-4098-bc6d-e3b37aeb0c44','BERNYANYI BERMASA','Arthama Hotel','Bernyanyi Bermasa merupakan karaoke event yang diadakan oleh Masa Kreatif bekerjasama dengan Authenticity dengan tujuan memberikan ruang bagi kita semua untuk berkumpul, bernyanyi, dan bersenang-senang bersama. Kali ini akan dipandu oleh Marlo Ernesto dan akan diiringi oleh Fian Rynaldy,pada tanggal 4 Agustus 2023.','https://sds.kartjis.id/api/uploaded-file/masa_1.jpeg','\"[{\\\"startTime\\\":1691146800,\\\"endTime\\\":1691164740}]\"','2023-07-19 15:06:38.205','2023-07-19 15:06:38.205'),('0e1692c3-1dd0-40b9-b6a6-636b1cc917b5','BERNYAYI BERMASA','Teratas Koffie Bar','Bernyanyi Bermasa merupakan karaoke event yang diadakan oleh Masa Kreatif dengan tujuan memberikan ruang bagi kita semua untuk berkumpul, bernyanyi, dan bersenang-senang bersama. Kali ini akan dipandu oleh Puput Hasyim & Irham Anugrah, diiringi oleh DJ Fian Rynaldy, berlangsung di Teratas Koffie & Bar pada tanggal 8 September 2023.','https://sds.kartjis.id/api/uploaded-file/masa_2.png','\"[{\\\"startTime\\\":1694172600,\\\"endTime\\\":1694188740}]\"','2023-08-22 09:07:53.445','2023-08-22 09:07:53.445'),('1a7ac852-3a9f-4c6e-a9ec-ba964854581b','ROAD TO Suara Dari Selatan','LAPANGAN PARKIR LOT AMBALAT TRANS STUDIO MALL MAKASSAR','Suara dari selatan adalah selebrasi pertunjukan musik Indonesia yang ada di makasar! yang dimana diselenggarakan oleh Hawaii Indonesia. Acara musik ini akan hadir selama 1 hari dengan konsep Road to pada tanggal 20 JULI 2023 bertempat di Lap Parking Lot Ambalat Trans Studio Mall Makasar! Menampilkan dua LEGENDA musik indonesia.','https://sds.kartjis.id/api/uploaded-file/FULL.jpg','\"[{\\\"startTime\\\":1689847200,\\\"endTime\\\":1689868740}]\"','2023-05-31 15:27:39.512','2023-05-31 15:27:39.512'),('5eb695f4-a349-4330-8603-1a5b6b192725','BERNYAYI BERMASA','Makassar (TBA)','Bernyanyi Bermasa merupakan karaoke event yang diadakan oleh Masa Kreatif bekerjasama dengan Authenticity dengan tujuan memberikan ruang bagi kita semua untuk berkumpul, bernyanyi, dan bersenang-senang bersama. Kali ini akan dipandu oleh Marlo Ernesto dan akan diiringi oleh Fian Rynaldy,pada tanggal 4 Agustus 2023.','https://sds.kartjis.id/api/uploaded-file/MASA.jpg','\"[{\\\"startTime\\\":1691146800,\\\"endTime\\\":1691164740}]\"','2023-08-22 09:07:12.621','2023-08-22 09:07:12.621'),('5fcafb12-87ed-466d-863e-6da97d6a4493','BERNYAYI BERMASA','Makassar (TBA)','Bernyanyi Bermasa merupakan karaoke event yang diadakan oleh Masa Kreatif bekerjasama dengan Authenticity dengan tujuan memberikan ruang bagi kita semua untuk berkumpul, bernyanyi, dan bersenang-senang bersama. Kali ini akan dipandu oleh Marlo Ernesto dan akan diiringi oleh Fian Rynaldy,pada tanggal 4 Agustus 2023.','https://sds.kartjis.id/api/uploaded-file/MASA.jpg','\"[{\\\"startTime\\\":1691146800,\\\"endTime\\\":1691164740}]\"','2023-08-22 09:05:57.324','2023-08-22 09:05:57.324'),('a1e2533f-dc43-4260-8b88-3429730e1d4e','Bernyanyi Bermasa','Portico Garage','Bernyanyi Bermasa merupakan karaoke event yang diadakan oleh Masa Kreatif dan kali ini berkolaborasi dengan REXLX dengan tujuan memberikan ruang bagi kita semua untuk berkumpul, bernyanyi, dan bersenang-senang bersama. Kali ini akan dipandu oleh Caca dari Younitedverse, diiringi oleh DJ Fian Rynaldy, berlangsung di Portico Garage pada tanggal 30 September 2023.','https://sds.kartjis.id/api/uploaded-file/masav3.jpg','\"[{\\\"startTime\\\":1696078800,\\\"endTime\\\":0}]\"','2023-09-26 15:32:26.402','2023-09-26 15:32:26.402'),('e495fb2c-f422-43bf-a815-2eb6967293e5','COBA-COBA : KOCK DITANGKIS 2023 IN COLLABORATION PARECU PODCAST','LAP. BULUTANGKIS POLTEKKES MAKASSAR','Jadilah saksi dari pertandingan terkonten di Kota Makassar ini! Prambors Makassar berkolaborasi dengan Parecu Podcast membuat KOCK DITANGKIS 2023 yang akan ada pertandingan utama : TUMMING/ABU vs IWAN COY/ZAKARIBO dan dibuka oleh pertandingan FIAN RINALDY/ZHADELA vs ALLI/INDAH PERMATASARI','https://sds.kartjis.id/api/uploaded-file/parecu.jpg','\"[{\\\"startTime\\\":1696662000,\\\"endTime\\\":1696662000}]\"','2023-09-22 17:15:27.127','2023-09-22 17:15:27.127'),('f68e8ec1-2af6-41de-90fa-fe521c5440b1','COBA-COBA : KOCK DITANGKIS 2023 IN COLLABORATION PARECU PODCAST','LAP. BULUTANGKIS POLTEKKES MAKASSAR','Jadilah saksi dari pertandingan terkonten di Kota Makassar ini! Prambors Makassar berkolaborasi dengan Parecu Podcast membuat KOCK DITANGKIS 2023 yang akan ada pertandingan utama : TUMMING/ABU vs IWAN COY/ZAKARIBO dan dibuka oleh pertandingan FIAN RINALDY/ZHADELA vs ALLI/INDAH PERMATASARI','https://sds.kartjis.id/api/uploaded-file/parecu.jpg','\"[{\\\"startTime\\\":1696662000,\\\"endTime\\\":1696662000}]\"','2023-09-26 15:32:03.800','2023-09-26 15:32:03.800'),('f75ec683-97f4-45d4-b493-1444e00de6d9','SOUNDS OF CALMER','Portico Garage','202 ENT TAKEOVER PRESENT SOUNDS OF CALMER, THE LEGEND OF UNDERGROUND BAR WAS EXIST IN MAKASSSAR. NOW WE GONNA BRING THE VIBE BACK OF CALMERGROUND IN THIS EVENT WITH THE MAD LINE UP THAT HAVE BEEN PLAYING AT CALMERGROUND. LETS DANCE & HAVE FUN ON THIS FRIDAY NIGHT 29 SEPTEMBER 2023. POWERED BY RELX_ID','https://sds.kartjis.id/api/uploaded-file/202.jpg','\"[{\\\"startTime\\\":1695992400,\\\"endTime\\\":0}]\"','2023-09-26 16:19:10.600','2023-09-26 16:19:10.600'),('fd361d90-6338-4542-843c-c25ac6838e04','WATASHI NIGHT CLUB 2023 - KARAOKE ANIME SOUNDTRACK','ONE NINE SKY LOUNGE - ARTHAMA HOTEL','Siapkan suaramu dan memori masa kecilmu untuk berkaraoke bersama! Akan dipandu oleh CAPUNG dan turut memeriahkan MONICA SALSABILA & FIAN RINALDY. Catat tanggalnya 2 September 2023 di One Nine Sky Lounge, Arthama Hotel.','https://sds.kartjis.id/api/uploaded-file/watashi_club.jpg','\"[{\\\"startTime\\\":1693659600,\\\"endTime\\\":1693670340}]\"','2023-08-26 14:39:41.654','2023-08-26 14:39:41.654');
